
function popsBaldioConstruido(feature, layer) {
    
    var popupContent =
    "<div id='Estilo1'><h3>Información Catastral <br> (Mayo 2024) </h3></div>" +
    "<hr class='hrx' style='color: #ef7d26;' align='left' noshade='noshade' size='2' width='100%' />" +
    "<div id='Estilo3a'>" +
    "<b>Catastro : </b>" + (feature.properties.CATASTRO) + "<br>" +
    "<b>Categoría : </b>" + "URBANO" + "<br>" +
    
    "<b>Edificado : </b>" + (feature.properties.TIPOEDIFICACION ? feature.properties.TIPOEDIFICACION.toUpperCase() : "") + "<br>" +
    "<br>" + "<br>" +
    "<b>Datos del Titular </b>" + "<br>" +

    "<b>Nombre titular (1): </b>" + (feature.properties.DOMNOMBRE ? feature.properties.DOMNOMBRE.toUpperCase() : "") + "<br>" +
    "<b>CUIT titular (1): </b>" + (feature.properties.CUIT ? feature.properties.CUIT.toUpperCase() : "") + "<br>" +
    "<br>" +

    "<b>Caracteristicas </b>" + "<br>" +
    "<b>Sup. Constuida (m2): </b>" + (feature.properties.Sup_m2 ) + "<br>" +
    "<b>Sup. Urbana (m2): </b>" + (feature.properties.SupUrb) + "<br>" +
   "<br>" +
  
   "<b>Valuación Mejoras : </b>" + (feature.properties.ValMejoras ) + "<br>" +
   "<b>Valuación Fiscal : </b>" + (feature.properties.Valor_FIS ) + "<br>" +
   "<b>Valuación Terreno : </b>" + (feature.properties.ValTerreno) + "<br>" +

    "<br>";


    return popupContent;
}
// funcion popous Con cuadro de texto - faltan definir los estilos1 2 3
function onEachFeature(feature, layer) {
    var popupContent = popsBaldioConstruido(feature);
    layer.bindPopup(popupContent);
}


function eventOpenPopup(e) {
    var layer = e.layer;
    layer.closePopup();
    layer.openPopup();
}


// Estilo para cada feature del GeoJSON
function styleBaldios(feature) {
    var color;
    if (feature.properties.TIPOEDIFICACION === 'Baldio') {
        color = '#fc4e2a';
    } else {
        color = 'gray';
    }
    return {
        weight: 0.6,
        opacity: 0.7,
        fillColor: color,
        color: "#000",
        dashArray: '0',
        fillOpacity: 0.9,
    };
}



